import React, { useEffect, useState } from 'react';

function WellnessReport() {
  const [data, setData] = useState([]);
  const [groupRollingAverages, setGroupRollingAverages] = useState([]);
  const [filteredGroupAverages, setFilteredGroupAverages] = useState([]);
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const [playerVisibility, setPlayerVisibility] = useState({});
  const [playerAverages, setPlayerAverages] = useState({});
  const [playerDateRange, setPlayerDateRange] = useState({});

  const sheetUrl = "https://opensheet.elk.sh/1x1e53gsx3VzEJ5ON5QOvYeJTGI8auMtSxJYYpUUmreY/Wallnes";

  useEffect(() => {
    fetch(sheetUrl)
      .then(res => res.json())
      .then(json => {
        const sortedData = json.map(entry => ({
          ...entry,
          date: new Date(entry.Date)
        })).filter(e => !isNaN(e.date)).sort((a, b) => a.date - b.date);

        setData(sortedData);
        calculateGroupRolling(sortedData);
        calculatePlayerStats(sortedData);
      });
  }, []);

  const calculateGroupRolling = (entries) => {
    const byDate = {};
    entries.forEach(entry => {
      const dateKey = entry.date.toISOString().split('T')[0];
      if (!byDate[dateKey]) byDate[dateKey] = [];
      byDate[dateKey].push(entry);
    });

    const result = Object.entries(byDate).slice(-5).map(([date, entries]) => {
      let sleep = 0, fatigue = 0, sore = 0;
      entries.forEach(e => {
        sleep += Number(e["What is the quality of your sleep at night?"]) || 0;
        fatigue += Number(e["How Fatigued are you?"]) || 0;
        sore += Number(e["How sore are you?"]) || 0;
      });
      const len = entries.length;
      return {
        date,
        sleep: (sleep / len).toFixed(2),
        fatigue: (fatigue / len).toFixed(2),
        sore: (sore / len).toFixed(2)
      };
    });

    setGroupRollingAverages(result);
  };

  const handleGroupFilter = () => {
    if (!startDate || !endDate) return;
    const filtered = data.filter(entry => {
      const date = new Date(entry.date);
      return date >= new Date(startDate) && date <= new Date(endDate);
    });
    calculateGroupRolling(filtered);
  };

  const calculatePlayerStats = (entries) => {
    const players = {};
    entries.forEach(entry => {
      const name = entry["Name"];
      if (!name) return;
      const date = entry.date.toISOString().split('T')[0];
      if (!players[name]) players[name] = {};
      if (!players[name][date]) players[name][date] = [];
      players[name][date].push(entry);
    });

    const result = {};
    Object.entries(players).forEach(([player, dates]) => {
      const sortedDates = Object.keys(dates).sort().reverse().slice(0, 10);
      result[player] = sortedDates.map(date => {
        const dayEntries = dates[date];
        let sleep = 0, fatigue = 0, sore = 0;
        dayEntries.forEach(e => {
          sleep += Number(e["What is the quality of your sleep at night?"]) || 0;
          fatigue += Number(e["How Fatigued are you?"]) || 0;
          sore += Number(e["How sore are you?"]) || 0;
        });
        const len = dayEntries.length;
        return {
          date,
          sleep: (sleep / len).toFixed(2),
          fatigue: (fatigue / len).toFixed(2),
          sore: (sore / len).toFixed(2)
        };
      });
    });
    setPlayerAverages(result);
  };

  const togglePlayer = (name) => {
    setPlayerVisibility(prev => ({ ...prev, [name]: !prev[name] }));
  };

  return (
    <div className="wellness-report" dir="rtl" style={{ padding: '20px' }}>
      <h1>דוח Wellness</h1>

      <h2>ממוצע קבוצתי - חמישה ימים אחרונים</h2>
      <table border="1" cellPadding="6" style={{ width: '100%', textAlign: 'center', marginBottom: '20px' }}>
        <thead>
          <tr>
            <th>תאריך</th>
            <th>שינה 💤</th>
            <th>עייפות 😴</th>
            <th>כאבי שרירים 💪</th>
          </tr>
        </thead>
        <tbody>
          {groupRollingAverages.map((d, i) => (
            <tr key={i}>
              <td>{d.date}</td>
              <td>{d.sleep}</td>
              <td>{d.fatigue}</td>
              <td>{d.sore}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <div>
        <h3>ממוצע קבוצתי לפי טווח תאריכים</h3>
        <label>מתאריך: <input type="date" value={startDate} onChange={(e) => setStartDate(e.target.value)} /></label>
        <label style={{ marginRight: '20px' }}>עד תאריך: <input type="date" value={endDate} onChange={(e) => setEndDate(e.target.value)} /></label>
        <button onClick={handleGroupFilter}>חשב ממוצע</button>
      </div>

      <h2 style={{ marginTop: '30px' }}>ממוצעים לפי שחקנית</h2>
      {Object.keys(playerAverages).map(name => (
        <div key={name} style={{ marginBottom: '20px' }}>
          <h3 style={{ cursor: 'pointer', color: 'blue' }} onClick={() => togglePlayer(name)}>{name}</h3>
          {playerVisibility[name] && (
            <>
              <table border="1" cellPadding="6" style={{ width: '100%', textAlign: 'center', marginBottom: '10px' }}>
                <thead>
                  <tr>
                    <th>תאריך</th>
                    <th>שינה</th>
                    <th>עייפות</th>
                    <th>כאבי שרירים</th>
                  </tr>
                </thead>
                <tbody>
                  {playerAverages[name].map((d, i) => (
                    <tr key={i}>
                      <td>{d.date}</td>
                      <td>{d.sleep}</td>
                      <td>{d.fatigue}</td>
                      <td>{d.sore}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
              <p>
                ממוצע 3 ימים: {averageLastNDays(playerAverages[name], 3)} | ממוצע 5 ימים: {averageLastNDays(playerAverages[name], 5)} | ממוצע 8 ימים: {averageLastNDays(playerAverages[name], 8)}
              </p>
            </>
          )}
        </div>
      ))}
    </div>
  );

  function averageLastNDays(data, n) {
    const slice = data.slice(0, n);
    if (slice.length === 0) return '0';
    let sleep = 0, fatigue = 0, sore = 0;
    slice.forEach(d => {
      sleep += Number(d.sleep);
      fatigue += Number(d.fatigue);
      sore += Number(d.sore);
    });
    const len = slice.length;
    return `שינה: ${(sleep / len).toFixed(2)}, עייפות: ${(fatigue / len).toFixed(2)}, שרירים: ${(sore / len).toFixed(2)}`;
  }
}

export default WellnessReport;
